import savings from '../../img/savings.svg' 

function Home(){
    return(
        <section>
            <h1>Bem vindo ao <span>Gerenciador de Projetos!</span></h1>
            <p>Comece a gerenciar seus projetos agora mesmo!</p>
            <a href="/">Criar projeto</a>
            <img src={savings}/>
        </section>
    )
} export default Home
